contracts/withoutMeta.sol.content:
// SPDX-License-Identifier: MIT

pragma solidity ^0.8.9;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/metatx/ERC2771Context.sol";
import "@openzeppelin/contracts/metatx/MinimalForwarder.sol";

contract withoutMeta is ERC721 {  

    // error
    error addressMismatching();
    error userIsNotRegisteredyet();
    error UserIsNotRegisteredForLand();

    //address:
    address public contractAdmin;
    address[] private allUserAddresses;

    // state variables
    uint private autoGenerateId;
    uint private nftAutoId;
    uint[] private autoIds;

    // event
    event UserRegistered(uint indexed _userId, address indexed _userAddress, uint indexed _status);
    event landRegisteredData(address indexed _user, uint indexed _plotId, bool indexed _registrationStatus);
    event NFTCreationInfo(address indexed _user, uint indexed _nftId, bool indexed _mintStatus);

    // struct: (total 16 fields)
     struct UserInformation{
        string _firstName;
        string _lastName;
        string _address;
        uint _ph_number;
        uint _pincode;
        string _city;
        string _country;
        string _email;
        address _walletAddress;
        string _dob;
        string _gender;
        string _age;
        string _martial_status;
        string _occupation;
        string _national_id;
        string _tin;
    }

    struct LandInformation{
        address _walletAddress;
        uint _uniqueId;
        string _capital;
        string _plotId;
        string _landType;
        string _streetName;
        uint _areaOfLand;
        uint _amountWillingToSell;
        uint _requestedAmountForSales;
        uint _timestampOfModification;
        string _transferDoc;
        string _GRA;
        string _MunicipalDoc;
        string _OriginalCertificate;
    }

    struct LandOwner{
        string _plotId;
        string _name;
        address _userAddress;
    }

    struct DocumentReceivedViaTransfer{
        string _firstname;
        string _plotId;
        address _walletAddress;
        string _transferDoc;
        string _GRA;
        string _MunicipalDoc;
        string _OriginalCertificate;
        uint _time;
    }

    struct LayoutInformation{
        string _plotId;
        string _coordinates;
        string _pdf;
    }


    // mapping:
    mapping(address => mapping(uint => bool)) private checkUserAddressAndIdLinked;
    // USER INFORMATION MAPPING:
    mapping(address => mapping(uint => UserInformation)) private userInfoStruct;
    // LAND INFORMATION MAPPING:
    mapping(address => mapping(string => LandInformation)) private landInfoStruct;
    mapping(address => bool) private userVerify;
    mapping(address => mapping(string => bool)) private landRegistered;
    mapping(string => LandOwner) private currentLandOwner;
    mapping(address => mapping(string => DocumentReceivedViaTransfer)) private docsReceived;
    mapping(string => string) private oldOwnerName;
    mapping(string => mapping(address => bool)) private currentLandOwnerInfo;
    mapping(string => LayoutInformation) private LayoutDetails;

    constructor() ERC721("Guyana Land Registry", "GLD") 
    {
        // code:
        contractAdmin = 0x85bA2D48fb1fb0ca47d48dc68fd16cfb7d4aCF96;
    }


    // function msg.sender internal view override(Context, ERC2771Context)
    //   returns (address sender) {
    //   sender = ERC2771Context.msg.sender;
    // }

    // function _msgData() internal view override(Context, ERC2771Context)
    //   returns (bytes calldata) {
    //   return ERC2771Context._msgData();
    // }

    modifier onlyAdmin(){
        require(contractAdmin == msg.sender, "only contractAdming can call this function");
        _;
    }

    /**
     * @param _userInfo - struct data
    */

    function UserRegistration( UserInformation memory _userInfo) public {
        UserInformation memory ui = _userInfo;
        // verification:
        if (msg.sender != ui._walletAddress){
            revert addressMismatching();
        }    
        uint incrementCreationId = 1;
        autoGenerateId = autoGenerateId + incrementCreationId;
        autoIds.push(autoGenerateId);
        // Add data to struct/mapping:
        userInfoStruct[msg.sender][autoGenerateId]._firstName = ui._firstName;
        userInfoStruct[msg.sender][autoGenerateId]._lastName = ui._lastName;
        userInfoStruct[msg.sender][autoGenerateId]._address = ui._address;
        userInfoStruct[msg.sender][autoGenerateId]._ph_number = ui._ph_number;
        userInfoStruct[msg.sender][autoGenerateId]._pincode = ui._pincode;
        userInfoStruct[msg.sender][autoGenerateId]._city = ui._city;
        userInfoStruct[msg.sender][autoGenerateId]._country = ui._country;
        userInfoStruct[msg.sender][autoGenerateId]._email = ui._email;
        userInfoStruct[msg.sender][autoGenerateId]._walletAddress = ui._walletAddress;
        userInfoStruct[msg.sender][autoGenerateId]._dob = ui._dob;
        userInfoStruct[msg.sender][autoGenerateId]._gender = ui._gender;
        userInfoStruct[msg.sender][autoGenerateId]._age = ui._age;
        userInfoStruct[msg.sender][autoGenerateId]._martial_status = ui._martial_status;
        userInfoStruct[msg.sender][autoGenerateId]._occupation = ui._occupation;
        userInfoStruct[msg.sender][autoGenerateId]._national_id = ui._national_id;
        userInfoStruct[msg.sender][autoGenerateId]._tin = ui._tin;
        // Link user:
        allUserAddresses.push(msg.sender);
        checkUserAddressAndIdLinked[msg.sender][autoGenerateId] = true;
        userVerify[msg.sender] = true;
        // event emit:
        emit UserRegistered(autoGenerateId, msg.sender, 200);
    }

    /**
     * Land Registration:
     * check whether he is valid useraddress and check user address and id is linked.
     * struct - capital, plotid, landtype, street name, total sq feet, willing to ask per sq feet, total land area, date in uinx
    */
    function LandRegistration(LandInformation memory _landInfo) external{
        LandInformation memory li = _landInfo;
        // verification:
        if(verifyUser(msg.sender) && checkUserAndIdVerification(msg.sender,li._uniqueId)){
            // Add data to struct/mapping:
            landInfoStruct[msg.sender][li._plotId]._walletAddress = li._walletAddress;
            landInfoStruct[msg.sender][li._plotId]._uniqueId = li._uniqueId;
            landInfoStruct[msg.sender][li._plotId]._capital = li._capital;
            landInfoStruct[msg.sender][li._plotId]._plotId = li._plotId;
            landInfoStruct[msg.sender][li._plotId]._landType = li._landType;
            landInfoStruct[msg.sender][li._plotId]._streetName = li._streetName;
            landInfoStruct[msg.sender][li._plotId]._areaOfLand = li._areaOfLand;
            landInfoStruct[msg.sender][li._plotId]._amountWillingToSell = li._amountWillingToSell;
            landInfoStruct[msg.sender][li._plotId]._requestedAmountForSales = li._requestedAmountForSales;
            landInfoStruct[msg.sender][li._plotId]._timestampOfModification = li._timestampOfModification;
            landInfoStruct[msg.sender][li._plotId]._transferDoc = li._transferDoc;
            landInfoStruct[msg.sender][li._plotId]._GRA = li._GRA;
            landInfoStruct[msg.sender][li._plotId]._MunicipalDoc = li._MunicipalDoc;
            landInfoStruct[msg.sender][li._plotId]._OriginalCertificate = li._OriginalCertificate;
            // Link user:
            landRegistered[msg.sender][li._plotId] = true;
            currentLandOwner[li._plotId]._plotId = li._plotId;
            currentLandOwner[li._plotId]._name = userInfoStruct[msg.sender][li._uniqueId]._firstName;
            currentLandOwner[li._plotId]._userAddress = li._walletAddress;
            // currentLandOwner[li._plotId]._nameOwnershipStatus[currentLandOwner[li._plotId]._name] = true;
            currentLandOwnerInfo[li._plotId][msg.sender] = true;
            oldOwnerName[li._plotId] = currentLandOwner[li._plotId]._name;
            // event emit:
            emit landRegisteredData(msg.sender, li._uniqueId, true);
        }else{
            revert userIsNotRegisteredyet();
        }
    }

    /**
     * BuyLandFromSeller 
     */
    function TransferDocumentsToBuyer(address _buyer, string memory _plotId, uint _nftId, string memory _buyerName) external{

        bytes32 ownerCheck = keccak256(abi.encodePacked(ownerOf(_nftId)));
        bytes32 callingOwner = keccak256(abi.encodePacked(msg.sender));
        if(ownerCheck == callingOwner){
             // store data in mapping:
            docsReceived[_buyer][_plotId]._walletAddress = landInfoStruct[msg.sender][_plotId]._walletAddress;
            docsReceived[_buyer][_plotId]._firstname = _buyerName;
            docsReceived[_buyer][_plotId]._plotId = _plotId;
            docsReceived[_buyer][_plotId]._transferDoc = landInfoStruct[msg.sender][_plotId]._transferDoc;
            docsReceived[_buyer][_plotId]._GRA = landInfoStruct[msg.sender][_plotId]._GRA;
            docsReceived[_buyer][_plotId]._MunicipalDoc = landInfoStruct[msg.sender][_plotId]._MunicipalDoc;
            docsReceived[_buyer][_plotId]._OriginalCertificate = landInfoStruct[msg.sender][_plotId]._OriginalCertificate;
            docsReceived[_buyer][_plotId]._time = block.timestamp;
            // transfer current status:
            currentLandOwner[_plotId]._plotId = _plotId;
            currentLandOwner[_plotId]._name = _buyerName;
            currentLandOwner[_plotId]._userAddress = _buyer;
            currentLandOwnerInfo[_plotId][_buyer] = true;
            // change old ownerStatus
            currentLandOwnerInfo[_plotId][msg.sender] = false;
            landRegistered[_buyer][_plotId] = true;
            // currentLandOwner[_plotId]._nameOwnershipStatus[oldOwnerName[_plotId]] = false;
            // transfer NFT:
            transferNFTToBuyer(_buyer, _nftId);
        }else{
             revert("owner address doesnt match with nft ownership");
        }
    }

    /**
     * Mint Nft by admin:
     * @notice createNftForRegisteredUsers
     * @param _userAddress - Enter the user address.
     * @param  _plotId - Enter the id created during registration.
     */

    function createNftForRegisteredUsers(address _userAddress, string memory _plotId) external onlyAdmin{
        if(landRegistered[_userAddress][_plotId]){
            uint incrementCreationId = 1;
            nftAutoId = nftAutoId + incrementCreationId;
            _safeMint(_userAddress, nftAutoId);
            emit NFTCreationInfo(_userAddress, nftAutoId, true);
        }else{
            revert UserIsNotRegisteredForLand();
        }
    }

    function transferNFTToBuyer(address _buyer, uint _nftId) internal{
        bytes32 ownerCheck = keccak256(abi.encodePacked(ownerOf(_nftId)));
        bytes32 callingOwner = keccak256(abi.encodePacked(msg.sender));
        if(ownerCheck == callingOwner){
            safeTransferFrom(msg.sender, _buyer, _nftId);
        }else{
            revert("owner address doesnt match with nft ownership");
        }
    }

    /**
     * Store Coordinates:
     */


    function LayoutCoordinates(LayoutInformation memory _layoutDetails) external onlyAdmin{
        LayoutDetails[_layoutDetails._plotId]._plotId = _layoutDetails._plotId;
        LayoutDetails[_layoutDetails._plotId]._coordinates = _layoutDetails._coordinates;
        LayoutDetails[_layoutDetails._plotId]._pdf = _layoutDetails._pdf;
    } 

    /**
     * Admin - store private key in the backend and then mint a fresh NFT for the user.
     */

    function getAllIds() public view returns (uint[] memory autoId){
        return autoIds;
    }

    function verifyUser(address _ad) public view returns(bool state){
        return userVerify[_ad];
    }

    function checkUserAndIdVerification(address _userAddress, uint _userID) public view returns(bool){
        return checkUserAddressAndIdLinked[_userAddress][_userID];
    }

    function getAllUserAddresses() external view returns (address[] memory userAddresses){
        return allUserAddresses;
    }

    function getUserDetailsStruct(address _userAddress, uint256 _userId) external view returns(UserInformation memory _userDetails){
        return userInfoStruct[_userAddress][_userId];
    }

    function getLandDetailsStruct(address _userAddress, string memory _plotId) external view returns(LandInformation memory _landDetails){
        return landInfoStruct[_userAddress][_plotId];
    }

    function receivedDocumentVerification(address _user, string memory _plotId) external view returns(DocumentReceivedViaTransfer memory documents){
        return docsReceived[_user][_plotId];
    }

    function landOwnershipDetails(address _user, string memory _plotId) external view returns(LandOwner memory landOwnerDetails, bool currentOwnerStatus){
        return (
            currentLandOwner[_plotId],
            currentLandOwnerInfo[_plotId][_user]
            );
    }

    function getLayoutInformation(string memory _plotId) external view returns(LayoutInformation memory _layoutDetials){
        return LayoutDetails[_plotId];
    }
}

