contracts/UserLandRegistration.sol.content:
// SPDX-License-Identifier: MIT

pragma solidity ^0.8.9;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/metatx/ERC2771Context.sol";
import "@openzeppelin/contracts/metatx/MinimalForwarder.sol";

contract UserLandRegistration is ERC2771Context, ERC721 {  

    // error
    error addressMismatching();
    error userIsNotRegisteredyet();
    error UserIsNotRegisteredForLand();
    error NotAnAdmin();

    //address:
    address public contractAdmin;
    address[] private allUserAddresses;
    address[] private adminAddresses;

    // state variables
    uint private autoGenerateId;
    uint private nftAutoId;
    uint[] private autoIds;

    // event
    event UserRegistered(uint indexed _userId, address indexed _userAddress, uint indexed _status);
    event LandRegisteredData(address indexed _user, uint indexed _plotId, uint indexed _status);
    event NFTCreationInfo(address indexed _user, uint indexed _nftId, uint indexed _status);
    event DocsAndNftTranferred(address indexed _to, uint indexed _nftId, uint indexed _status);
    event LayoutDetailsInfo(string indexed _plotId, string[] indexed _coordinates, uint indexed _status);

    // struct: (total 16 fields)
    struct UserInformation{
        string _name;
        string _ph_number;
        string _pincode;
        string _email;
        address _walletAddress;
        string _gender;
        string _national_id;
        string _tin;
    }

    struct LandInformation{
        address _walletAddress;
        uint _uniqueId;
        string _plotId;
        string _landType;
        uint _areaOfLand;
        uint _timestampOfModification;
        string _docs;
    }

    struct LandOwner{
        string _plotId;
        string _name;
        address _userAddress;
    }

    struct DocumentReceivedViaTransfer{
        string _firstname;
        string _plotId;
        address _walletAddress;
        string _docs;
        uint _time;
    }

    struct LayoutInformation{
        string plotId;
        string[] coordinates;
        string[] masterCoordinate;
    }

    struct Layout {
        string groupCoordinates_lattitude;
        string groupCoordinates_longitude;
    }

    struct LayoutMaster {
        string masterLang;
        string masterLong;
    }

    mapping(string => Layout[]) private layoutData;
    mapping(string => LayoutMaster) private layoutMas;


    // mapping:
    mapping(address => mapping(uint => bool)) private checkUserAddressAndIdLinked;
    // USER INFORMATION MAPPING:
    mapping(address => mapping(uint => UserInformation)) private userInfoStruct;
    // LAND INFORMATION MAPPING:
    mapping(address => mapping(string => LandInformation)) private landInfoStruct;
    mapping(address => bool) private userVerify;
    mapping(address => mapping(string => bool)) private landRegistered;
    mapping(string => LandOwner) private currentLandOwner;
    mapping(address => mapping(string => DocumentReceivedViaTransfer)) private docsReceived;
    mapping(string => string) private oldOwnerName;
    mapping(string => mapping(address => bool)) private currentLandOwnerInfo;
    mapping(string => LayoutInformation) private LayoutDetails;
    mapping(address => bool) private admins;


    modifier onlyAdmin() {
        if (contractAdmin == _msgSender() || admins[_msgSender()]) {
            _;
        } else {
            revert NotAnAdmin();
        }
    }

    /**
     * @notice - Constructor
     * @param forwarder - Enter the forwarder address
     * @param _contractAdmin - Enter the contract admine address
     */
    constructor(MinimalForwarder forwarder, address _contractAdmin) ERC721("Guyana Land Registry", "GLD") 
    ERC2771Context(address(forwarder)) {
        // code:
        contractAdmin = _contractAdmin;
    }


    function _msgSender() internal view override(Context, ERC2771Context)
      returns (address sender) {
      sender = ERC2771Context._msgSender();
    }

    function _msgData() internal view override(Context, ERC2771Context)
      returns (bytes calldata) {
      return ERC2771Context._msgData();
    }

    /**
        * @notice admin can call this function to register a driver
        * @dev modifier onlyAdmin is used here. only one of the registered admins can call this function
        * @param _ad add address of admins to the contract.
    */
    function addAdmin(address _ad) external returns(bool){
        if(_msgSender() == contractAdmin){
            admins[_ad] = true;
            adminAddresses.push(_ad);
            return admins[_ad];
        }else{
            revert NotAnAdmin();
        }
    }

    mapping(address => mapping(string => uint)) private userRegMap; // user autoId
    mapping(address => mapping(string => uint)) private eventForUserRegMap; // returns 200

    function readuserRegMap(address _user, string memory _nationalId) external view returns(uint uniqueId){
        return userRegMap[_user][_nationalId];
    }

    function readeventForUserRegMap(address _user, string memory _nationalId) external view returns(uint status){
        return eventForUserRegMap[_user][_nationalId];
    }

    /**
     * @notice - UserRegistration
     * @param _userInfo - Enter the userInformation in struct format
     */
    function UserRegistration(UserInformation memory _userInfo) public {
        UserInformation memory ui = _userInfo;
        // verification:
        if (_msgSender() != ui._walletAddress){
            revert addressMismatching();
        }    
        uint incrementCreationId = 1;
        autoGenerateId = autoGenerateId + incrementCreationId;
        autoIds.push(autoGenerateId);
        // Add data to struct/mapping:
        userInfoStruct[_msgSender()][autoGenerateId]._name = ui._name;
        userInfoStruct[_msgSender()][autoGenerateId]._ph_number = ui._ph_number;
        userInfoStruct[_msgSender()][autoGenerateId]._pincode = ui._pincode;
        userInfoStruct[_msgSender()][autoGenerateId]._email = ui._email;
        userInfoStruct[_msgSender()][autoGenerateId]._walletAddress = ui._walletAddress;
        userInfoStruct[_msgSender()][autoGenerateId]._gender = ui._gender;
        userInfoStruct[_msgSender()][autoGenerateId]._national_id = ui._national_id;
        userInfoStruct[_msgSender()][autoGenerateId]._tin = ui._tin;
        // Link user:
        allUserAddresses.push(_msgSender());
        checkUserAddressAndIdLinked[_msgSender()][autoGenerateId] = true;
        userVerify[_msgSender()] = true;
        // event emit:
        userRegMap[_msgSender()][ui._national_id] = autoGenerateId;
        eventForUserRegMap[_msgSender()][ui._national_id] = 200;
        emit UserRegistered(autoGenerateId, _msgSender(), 200);
    }

    mapping(address => mapping(string => uint)) private eventForLandRegMap; // returns 200

    function readeventForLandRegMap(address _user, string memory _plot) external view returns(uint status){
        return eventForLandRegMap[_user][_plot];
    }

    /**
     * @notice - LandRegistration
     * @param _landInfo - Enter the land information struct
     */
    function LandRegistration(LandInformation memory _landInfo) external{
        LandInformation memory li = _landInfo;
        // verification:
        if(verifyUser(_msgSender()) && checkUserAndIdVerification(_msgSender(),li._uniqueId)){
            // Add data to struct/mapping:
            landInfoStruct[_msgSender()][li._plotId]._walletAddress = li._walletAddress;
            landInfoStruct[_msgSender()][li._plotId]._uniqueId = li._uniqueId;
            landInfoStruct[_msgSender()][li._plotId]._plotId = li._plotId;
            landInfoStruct[_msgSender()][li._plotId]._landType = li._landType;
            landInfoStruct[_msgSender()][li._plotId]._areaOfLand = li._areaOfLand;
            landInfoStruct[_msgSender()][li._plotId]._timestampOfModification = li._timestampOfModification;
            landInfoStruct[_msgSender()][li._plotId]._docs = li._docs;
            // Link user:
            landRegistered[_msgSender()][li._plotId] = true;
            currentLandOwner[li._plotId]._plotId = li._plotId;
            currentLandOwner[li._plotId]._name = userInfoStruct[_msgSender()][li._uniqueId]._name;
            currentLandOwner[li._plotId]._userAddress = li._walletAddress;
            currentLandOwnerInfo[li._plotId][_msgSender()] = true;
            oldOwnerName[li._plotId] = currentLandOwner[li._plotId]._name;
            // event emit:
            eventForLandRegMap[_msgSender()][li._plotId] = 200;
            emit LandRegisteredData(_msgSender(), li._uniqueId, 200);
        }else{
            revert userIsNotRegisteredyet();
        }
    }

    mapping(address => mapping(string => uint)) private transferMap; // nft
    mapping(address => mapping(string => uint)) private eventForTransferMap; // returns 200

    function readtransferMap(address _buyer, string memory _plotId) external view returns(uint nftId){
        return transferMap[_buyer][_plotId];
    }

    function readeventForTransferMap(address _buyer, string memory _plotId) external view returns(uint status){
        return eventForTransferMap[_buyer][_plotId];
    }

    /**
     * @notice - TransferDocumentsToBuyer
     * @param _buyer - Enter the buyer address.
     * @param _plotId - Enter the plot id.
     * @param _nftId - Enter the NFT id.
     * @param _buyerName - Enter the buyer name.
     */
    function TransferDocumentsToBuyer(address _buyer, string memory _plotId, uint _nftId, string memory _buyerName) external{
        bytes32 ownerCheck = keccak256(abi.encodePacked(ownerOf(_nftId)));
        bytes32 callingOwner = keccak256(abi.encodePacked(_msgSender()));
        if(ownerCheck == callingOwner){
             // store data in mapping:
            docsReceived[_buyer][_plotId]._walletAddress = landInfoStruct[_msgSender()][_plotId]._walletAddress;
            docsReceived[_buyer][_plotId]._firstname = _buyerName;
            docsReceived[_buyer][_plotId]._plotId = _plotId;
            docsReceived[_buyer][_plotId]._docs = landInfoStruct[_msgSender()][_plotId]._docs;
            docsReceived[_buyer][_plotId]._time = block.timestamp;
            // transfer current status:
            currentLandOwner[_plotId]._plotId = _plotId;
            currentLandOwner[_plotId]._name = _buyerName;
            currentLandOwner[_plotId]._userAddress = _buyer;
            currentLandOwnerInfo[_plotId][_buyer] = true;
            // change old ownerStatus
            currentLandOwnerInfo[_plotId][_msgSender()] = false;
            landRegistered[_buyer][_plotId] = true;
            // transfer NFT:
            transferNFTToBuyer(_buyer, _nftId);
            // event:
            transferMap[_buyer][_plotId] = _nftId;
            eventForTransferMap[_buyer][_plotId] = 200;
            emit DocsAndNftTranferred(_buyer, _nftId, 200);
        }else{
             revert("owner address doesnt match with nft ownership");
        }
    }

    mapping(address => mapping(string => uint)) private createNFTMap; // nft
    mapping(address => mapping(string => uint)) private eventForCreateNFTMap; // returns 200

    function readcreateNFTMap(address _userAddress, string memory _plotId) external view returns(uint nftId){
        return createNFTMap[_userAddress][_plotId];
    }

    function readeventForCreateNFTMap(address _userAddress, string memory _plotId) external view returns(uint status){
        return eventForCreateNFTMap[_userAddress][_plotId];
    }

    /**
     * @notice createNftForRegisteredUsers (Mint Nft by admin)
     * @param _userAddress - Enter the user address.
     * @param  _plotId - Enter the id created during registration.
     */
    function createNftForRegisteredUsers(address _userAddress, string memory _plotId) external onlyAdmin{
        if(landRegistered[_userAddress][_plotId]){
            uint incrementCreationId = 1;
            nftAutoId = nftAutoId + incrementCreationId;
            _safeMint(_userAddress, nftAutoId);
            // events:
            createNFTMap[_userAddress][_plotId] = nftAutoId;
            eventForCreateNFTMap[_userAddress][_plotId] = 200;
            emit NFTCreationInfo(_userAddress, nftAutoId, 200);
        }else{
            revert UserIsNotRegisteredForLand();
        }
    }

    /**
     * @notice - transferNFTToBuyer : Internal
     * @param _buyer - Enter the buyer address.
     * @param _nftId - Enter the NFT id.
     */
    function transferNFTToBuyer(address _buyer, uint _nftId) internal{
        bytes32 ownerCheck = keccak256(abi.encodePacked(ownerOf(_nftId)));
        bytes32 callingOwner = keccak256(abi.encodePacked(_msgSender()));
        if(ownerCheck == callingOwner){
            safeTransferFrom(_msgSender(), _buyer, _nftId);
        }else{
            revert("owner address doesnt match with nft ownership");
        }
    }

    // LAYOUT: 

    mapping(string => uint) private layoutStatus; // return 200.

    function readlayoutStatus(string memory _plotId) external view returns(uint status){
        return layoutStatus[_plotId];
    }

    /**
     * @notice - LayoutCoordinatesStore
     * @param id - Enter the plot id.
     * @param _nest - Enter the group coordinates plot.
     * @param _lay - Enter the master coordinates.
     */
    function LayoutCoordinatesStore(string memory id, Layout[] memory _nest, LayoutMaster memory _lay) external {
        for (uint i = 0; i < _nest.length; i++){
            layoutData[id].push(_nest[i]);
        }
        layoutMas[id].masterLang = _lay.masterLang;
        layoutMas[id].masterLong = _lay.masterLong;
        layoutStatus[id] = 200;
    }


// -------------------------------------------------------------------------X
// --------------------------------READ FUNCTION-----------------------------
// -------------------------------------------------------------------------X

    function getAllIds() public view returns (uint[] memory autoId){
        return autoIds;
    }

    /**
     * @notice - verifyUser
     * @param _ad - Enter user address
     */
    function verifyUser(address _ad) public view returns(bool state){
        return userVerify[_ad];
    }

    /**
     * @notice - checkUserAndIdVerification
     * @param _userAddress - Enter the user address.
     * @param _userID - Enter the unique id generated while user registration.
     */
    function checkUserAndIdVerification(address _userAddress, uint _userID) public view returns(bool){
        return checkUserAddressAndIdLinked[_userAddress][_userID];
    }

    function getAllUserAddresses() external view returns (address[] memory userAddresses){
        return allUserAddresses;
    }

    /**
     * @notice - getUserDetailsStruct
     * @param _userAddress - Enter the user address.
     * @param _userId - Enter the unique id generated while user registration.
     */
    function getUserDetailsStruct(address _userAddress, uint256 _userId) external view returns(UserInformation memory _userDetails){
        return userInfoStruct[_userAddress][_userId];
    }

    /**
     * @notice - getLandDetailsStruct
     * @param _userAddress - Enter the user address.
     * @param _plotId - Enter the plot id.
     */
    function getLandDetailsStruct(address _userAddress, string memory _plotId) external view returns(LandInformation memory _landDetails){
        return landInfoStruct[_userAddress][_plotId];
    }

    /**
     * @notice - receivedDocumentVerification
     * @param _userAddress - Enter the user address.
     * @param _plotId - Enter the plot id.
     */
    function receivedDocumentVerification(address _userAddress, string memory _plotId) external view returns(DocumentReceivedViaTransfer memory documents){
        return docsReceived[_userAddress][_plotId];
    }

    /**
     * @notice - landOwnershipDetails
     * @param _userAddress - Enter the user address.
     * @param _plotId Enter the plot id.
     * @return landOwnerDetails - returns the current land owner details.
     * @return currentOwnerStatus  - returns current land owner information.
     */
    function landOwnershipDetails(address _userAddress, string memory _plotId) external view returns(LandOwner memory landOwnerDetails, bool currentOwnerStatus){
        return (
            currentLandOwner[_plotId],
            currentLandOwnerInfo[_plotId][_userAddress]
            );
    }


    /**
     * @notice - getLayoutInformation
     * @param id - Enter the plot id.
     * @return layoutName - Returns the plot name
     * @return layout - Return the group coordinate info.
     * @return master - Returns the master coordinate info.
     */
    function getLayoutInformation(string memory id) public view returns (string memory layoutName, Layout[] memory layout, LayoutMaster memory master ) {
        return (
            id,
            layoutData[id],
            layoutMas[id]
        );
    }


}

